import React, {useState,useEffect} from 'react'

function DetailPage({match}) {

    const [country,setCountry] = useState([])

    useEffect(() =>{
        const match = match.params.id.toLowerCase()
        fetch('https://restcountries.com/v3.1/' + match.params.id)
        .then(res => res.json())
        .then(data => setCountry(data))

    },[])
    return (
        <div>
            <h1>details</h1>
            {match.params.id}
        </div>
    )
}

export default DetailPage
